Sporazumom uz saglasnost Zaposlenog i Poslodavca, prema zakonskoj moći u slučajevima predviđenim članom 67 Zakona o radu ili drugim važećim zakonima u Kosovskom zakonodavstvu.
Jednostrano od strane Poslodavca uz obaveštenje od šezdeset (60) dana:
• Poslodavac ima ekonomske, tehničke ili organizacione razloge za takav postupak;
• Zaposleni više nije sposoban da obavlja radne zadatke;
• Zaposleni je odgovoran za teške prekršaje unutrašnjih pravila;
• Zaposleni nije ispunjavao radne zadatke na zadovoljavajući način i nije se poboljšao ni nakon upozorenja Poslodavca.
Jednostrano od strane Zaposlenog:
• Uz pisano obaveštenje dostavljeno Poslodavcu najmanje trideset (30) dana pre datuma kada se planira prekid Ugovora. Član 10: Rešavanje Sporova
Sve nesuglasice, neslaganja ili zahtevi koji proizlaze iz ili u vezi sa ovim ugovorom, strane se slažu da prvo pokušaj
